  \"Aleutian Canada goose transplant from Buldir Island to Agattu Island, Aleutian
  Islands, Alaska, summer 1984\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:03:13.281151\",\n\t\"name\": \"aleutian-canada-goose-transplant-from-buldir-island-to-agattu-island-aleutian-islands-alas\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Geese were captured on Buldir Island by
  searching the upper and lower edge of the lowland tall plant association where tall
  plants offer cover and short plants offer succulent food. When the geese were captured,
  they were sexed, aged and banded with a numbered colored plastic leg band and size
  7B FNS leg band. Within 72 hours after capture the birds were transported to Agattu
  via the charter vessel \"Vestfjord\" and released at Goose Creek in Aga Cove, Agattu
  Island. A total of 92 geese were captured on Buldir. Of this number, four died in
  the capture or transplant efforts. The four birds that died represented a four percent
  mortality factor for all the birds captured and transplanted. A total of 88 Aleutian
  Canada geese composed of 56 goslings and 32 adults were successfully transplanted
  and released on Agattu Island. The capture and transplant of wild Aleutian Canada
  geese from Buldir Island is the most efficient method for reestablishing nesting
  populations of this sub-species on islands cleared of foxes where the geese historically
  nested (prior to the introduction of foxes near the turn of the century). This was
  confirmed earlier this summer when three nests and one brood were found at Cape
  Sabak, Agattu Island. Continuation of transplant efforts will lead to reestablishment
  of nesting populations of this endangered sub-species on Agattu and other islands
  and hopefully lead to the species eventual removal from the endangered species list.\",\n\t\"license_title\":
